// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract ConstantProductAMM {
    IERC20 public token0;
    IERC20 public token1;

    uint256 public reserve0; // token0 的储备
    uint256 public reserve1; // token1 的储备

    uint256 public totalSupply; // LP Token 总供应量
    mapping(address => uint256) public balanceOf; // 用户的 LP Token 余额

    // 事件日志
    event AddLiquidity(address indexed provider, uint256 amount0, uint256 amount1, uint256 liquidity);
    event RemoveLiquidity(address indexed provider, uint256 amount0, uint256 amount1, uint256 liquidity);
    event Swap(address indexed trader, IERC20 inputToken, uint256 inputAmount, uint256 outputAmount);

    constructor(IERC20 _token0, IERC20 _token1) {
        token0 = _token0;
        token1 = _token1;
    }

    function addLiquidity(uint256 amount0, uint256 amount1) external {
        require(amount0 > 0 && amount1 > 0, "Invalid amounts");

        // 将代币从用户转入合约
        token0.transferFrom(msg.sender, address(this), amount0);
        token1.transferFrom(msg.sender, address(this), amount1);

        uint256 liquidity;
        if (totalSupply == 0) {
            // 初次添加流动性
            liquidity = sqrt(amount0 * amount1);
        } else {
            // 按比例计算新增流动性
            liquidity = min(
                (amount0 * totalSupply) / reserve0,
                (amount1 * totalSupply) / reserve1);
        }
        require(liquidity > 0, "Insufficient liquidity minted");
        // 更新池的余额
        reserve0 += amount0;
        reserve1 += amount1;

        // 分配 LP Token
        balanceOf[msg.sender] += liquidity;
        totalSupply += liquidity;

        emit AddLiquidity(msg.sender, amount0, amount1, liquidity);
    }

    function swap(IERC20 inputToken, uint256 inputAmount) external {
        require(inputToken == token0 || inputToken == token1, "Invalid token");

        // 确保输入代币非零
        bool isToken0 = (inputToken == token0);
        IERC20 outputToken = isToken0 ? token1 : token0;

        uint256 inputReserve = isToken0 ? reserve0 : reserve1;
        uint256 outputReserve = isToken0 ? reserve1 : reserve0;

        require(
            inputAmount > 0 && inputAmount < inputReserve,
            "Invalid input amount"
        );

        // 恒定乘积公式: xy = (x+ Δx)(y- Δy) = k
        // Δy = (Δx * y) / (x + Δx)
        // 假设 0.3% 交易费,inputAfterFee为去掉交易费后的实际输入金额
        uint256 inputAfterFee = (inputAmount * 997) / 1000;
        uint256 outputAmount = (inputAfterFee * outputReserve) /
            (inputReserve + inputAfterFee);

        require(outputAmount > 0, "Insufficient output amount");

        // 转入输入代币
        inputToken.transferFrom(msg.sender, address(this), inputAmount);

        // 转出输出代币
        outputToken.transfer(msg.sender, outputAmount);

        // 更新储备
        if (isToken0) {
            reserve0 += inputAmount;
            reserve1 -= outputAmount;
        } else {
            reserve1 += inputAmount;
            reserve0 -= outputAmount;
        }

        emit Swap(msg.sender, inputToken, inputAmount, outputAmount);
    }

    function removeLiquidity(uint256 liquidity) external {
        require(liquidity > 0 && balanceOf[msg.sender] >= liquidity, "Invalid liquidity amount");


        uint256 amount0 = (reserve0 * liquidity) / totalSupply;
        uint256 amount1 = (reserve1 * liquidity) / totalSupply;

        require(amount0 > 0 && amount1 > 0, "Invalid amounts");

        // 更新储备
        reserve0 -= amount0;
        reserve1 -= amount1;

        // 减少用户的 LP Token 并更新总供应量
        balanceOf[msg.sender] -= liquidity;
        totalSupply -= liquidity;

        // 转回代币
        token0.transfer(msg.sender, amount0);
        token1.transfer(msg.sender, amount1);

        emit RemoveLiquidity(msg.sender, amount0, amount1, liquidity);
    }

    //   // 同步储备值
    // function sync() external {
    //     reserve0 = token0.balanceOf(address(this));
    //     reserve1 = token1.balanceOf(address(this));
    // }

    // 辅助函数：取两个数的最小值
    function min(uint256 x, uint256 y) private pure returns (uint256) {
        return x < y ? x : y;
    }

    // 辅助函数：计算平方根
    function sqrt(uint256 y) private pure returns (uint256) {
        uint256 z = (y + 1) / 2;
        uint256 x = y;
        while (z < x) {
            x = z;
            z = (y / z + z) / 2;
        }
        return x;
    }
}

